   // water\n    int totalWater = 0;\n    for (int k = 1; k < n - 1; ++k) { // do not consider the first and the last places\n        int water = Math.min(leftMax[k - 1], rightMax[k + 1]) - height[k];\n        totalWater += (water > 0) ? water : 0;\n    }\n    return totalWater;\n}\n// TC : O(n)\n// SC : O(n)\n"))),(0,r.kt)(l.Z,{value:"method-2",label:"Method 2 - No Space",mdxType:"TabItem"},(0,r.kt)("pre",null,(0,r.kt)("code",{parentName:"pre",className:"language-java"},"public int trap(int[] height) {\n    if (height.length==0) return 0; \n    int left = 0, right = height.length-1; \n    int leftMax=0, rightMax=0; \n    int ans = 0; \n    while (left < right) {\n        if (height[left] > leftMax) leftMax = height[left]; \n        if (height[right] > rightMax) rightMax = height[right];\n        if (leftMax < rightMax) {\n            ans += Math.max(0, leftMax-height[left]); \n            left++; \n        } else {\n            ans += Math.max(0, rightMax-height[right]); \n            right--; \n        }\n    }\n    return ans; \n}\n// TC : O(n)\n// SC : O(1)\n")))),(0,r.kt)("h2",{id:"next-permutation"},"Next Permutation"),(0,r.kt)("h3",{id:"problem-statement-1"},"Problem Statement"),(0,r.kt)("p",null,(0,r.kt)("img",{src:n(8174).Z,width:"798",height:"590"})),(0,r.kt)("div",{class:"section-container pl0 pr0"},(0,r.kt)("div",{class:"section-item pl0"},(0,r.kt)("pre",null,(0,r.kt)("code",{parentName:"pre",className:"language-java"},"Consists of Two Parts one is finding the highest and just lowest element to the highest when starting from the end.\nThen we can swap the highest and lowest element and reverse the rest of the elements, to the index that was found.\n")),(0,r.kt)("p",null,(0,r.kt)("img",{src:n(1092).Z,width:"873",height:"370"}))),(0,r.kt)("div",{class:"section-item"},(0,r.kt)("pre",null,(0,r.kt)("code",{parentName:"pre",className:"language-java"},"class Solution {\n    public void swap(int arr[], int i, int j){\n        int temp = arr[i];\n        arr[i] = arr[j];\n        arr[j] = temp;\n    }\n    \n    public void reverse(int arr[], int i, int j){\n        while(i < j) swap(arr, i++, j--);\n    }\n    \n    public void nextPermutation(int[] nums) {\n        if(nums == null || nums.length <= 1) return;\n        int i = nums.length - 2;\n        while(i >= 0 && nums[i] >= nums[i+1]) i--;\n        if(i >= 0){\n            int j = nums.length - 1;\n            while(nums[j] <= nums[i]) j--;\n            swap(nums, i, j);\n        }\n        reverse(nums, i+1, nums.length - 1);\n    }\n}\n// TC : O(n)\n// SC : O(1)\n")))),(0,r.kt)("h2",{id:"largest-plus-sign"},"Largest Plus Sign"),(0,r.kt)("h3",{id:"problem-statement-2"},"Problem Statement"),(0,r.kt)("p",null,(0,r.kt)("img",{src:n(3608).Z,width:"1004",height:"803"})),(0,r.kt)(i.Z,{mdxType:"Tabs"},(0,r.kt)(l.Z,{value:"method-1",label:"Explanation",default:!0,mdxType:"TabItem"},(0,r.kt)("div",{class:"section-container pl0 pr0"},(0,r.kt)("div",{class:"section-item pl0"},(0,r.kt)("p",null,"Using DP would be a good idea. There will be two process involved in the making of the 2D Dimensional Array.\nFirst, we will make a 2D Array of size (Rows, Columns) and fill it with 0.\nSecond we would fill the 2D DP Array with the count or extension of how much 1's are present in the left and right of the array."),(0,r.kt)("p",null,"For example, if we have the following array given in the problem statement.\nWe would have to create a first iteration Matrix like this:"),(0,r.kt)("p",null,(0,r.kt)("img",{src:n(1768).Z,width:"110",height:"96"}))),(0,r.kt)("div",{class:"section-item"},(0,r.kt)("p",null,"Secondly we would have to apply our mind to producing the array matrix as below:"),(0,r.kt)("p",null,(0,r.kt)("img",{src:n(7607).Z,width:"111",height:"92"})),(0,r.kt)("p",null,"At the same time we would keep a ans counter which will be calculating the largest plus sign.")))),(0,r.kt)(l.Z,{value:"method-2",label:"Solution - DP",mdxType:"TabItem"},(0,r.kt)("pre",null,(0,r.kt)("code",{parentName:"pre",className:"language-java"},"\nclass Solution {\n    public int orderOfLargestPlusSign(int N, int[][] mines) {\n        Set<Integer> banned = new HashSet();\n        int[][] dp = new int[N][N];\n        \n        for (int[] mine: mines)\n            banned.add(mine[0] * N + mine[1]);\n        int ans = 0, count;\n        \n        for (int r = 0; r < N; ++r) {\n            count = 0;\n            for (int c = 0; c < N; ++c) {\n                count = banned.contains(r*N + c) ? 0 : count + 1;\n                dp[r][c] = count;\n            }\n            \n            count = 0;\n            for (int c = N-1; c >= 0; --c) {\n                count = banned.contains(r*N + c) ? 0 : count + 1;\n                dp[r][c] = Math.min(dp[r][c], count);\n            }\n        }\n        for (int c = 0; c < N; ++c) {\n            count = 0;\n            for (int r = 0; r < N; ++r) {\n                count = banned.contains(r*N + c) ? 0 : count + 1;\n                dp[r][c] = Math.min(dp[r][c], count);\n            }\n            \n            count = 0;\n            for (int r = N-1; r >= 0; --r) {\n                count = banned.contains(r*N + c) ? 0 : count + 1;\n                dp[r][c] = Math.min(dp[r][c], count);\n                ans = Math.max(ans, dp[r][c]);\n            }\n            \n        }\n        return ans;\n    }\n}\n")))),(0,r.kt)("hr",null),(0,r.kt)("h2",{id:"re-organize-string"},"Re-organize String"),(0,r.kt)(i.Z,{mdxType:"Tabs"},(0,r.kt)(l.Z,{value:"method-1",label:"Problem Statement",mdxType:"TabItem"},(0,r.kt)("p",null,(0,r.kt)("img",{src:n(8221).Z,width:"677",height:"535"}))),(0,r.kt)(l.Z,{value:"method-2",label:"Approach/Solution",default:!0,mdxType:"TabItem"},(0,r.kt)("div",{class:"section-container pl0 pr0"},(0,r.kt)("div",{class:"section-item pl0"},(0,r.kt)("pre",null,(0,r.kt)("code",{parentName:"pre",className:"language-java"},"Idea behind the approach is that we have to sort the Characters in the String as per their frequencies.\nAnd fur